import React from "react";
import Expenses from "./Expenses";
import Goals from "./Goals";
import Trades from "./Trades";

const Dashboard = () => {
  return (
    <div className="dashboard">
      <h1>Dashboard</h1>

      {/* Portfolio Section */}
      <section>
        <h2>Portfolio / Trades</h2>
        <Trades />
      </section>

      {/* Expenses Section */}
      <section>
        <h2>Expenses</h2>
        <Expenses />
      </section>

      {/* Goals Section */}
      <section>
        <h2>Goals</h2>
        <Goals />
      </section>
    </div>
  );
};

export default Dashboard;
